INSERT INTO dqm.reglas_calidad VALUES (1, 'VENTA_PRECIO_NO_NEGATIVO', 'El precio unitario no puede ser menor a cero.', 'dwa_fact_ventas', 'precio_unitario', 'Validez', 0.00, 'SELECT COUNT(*) FROM dwa_fact_ventas WHERE precio_unitario < 0');
INSERT INTO dqm.reglas_calidad VALUES (3, 'VENTA_CANTIDAD_NO_NEGATIVA', 'La cantidad vendida de un producto no puede ser cero o negativa.', 'dwa_fact_ventas', 'cantidad', 'Validez', 0.00, 'SELECT COUNT(*) FROM dwa_fact_ventas WHERE cantidad <= 0');
INSERT INTO dqm.reglas_calidad VALUES (4, 'VENTA_DESCUENTO_RANGO_VALIDO', 'El descuento aplicado debe estar entre 0 y 1 (0% y 100%).', 'dwa_fact_ventas', 'descuento', 'Validez', 0.50, 'SELECT COUNT(*) FROM dwa_fact_ventas WHERE descuento < 0 OR descuento > 1');
INSERT INTO dqm.reglas_calidad VALUES (5, 'VENTA_FK_CLIENTE_COMPLETA', 'Todas las ventas deben estar asociadas a un cliente válido.', 'dwa_fact_ventas', 'cliente_sk', 'Completitud', 1.00, 'SELECT COUNT(*) FROM dwa_fact_ventas WHERE cliente_sk IS NULL');
INSERT INTO dqm.reglas_calidad VALUES (6, 'VENTA_FK_PRODUCTO_COMPLETA', 'Todas las ventas deben estar asociadas a un producto válido.', 'dwa_fact_ventas', 'producto_sk', 'Completitud', 1.00, 'SELECT COUNT(*) FROM dwa_fact_ventas WHERE producto_sk IS NULL');
INSERT INTO dqm.reglas_calidad VALUES (7, 'CLIENTE_NOMBRE_COMPLETO', 'El nombre de la compañía del cliente no puede ser nulo o vacío.', 'dwa_dim_cliente', 'nombre_compania', 'Completitud', 2.00, 'SELECT COUNT(*) FROM dwa_dim_cliente WHERE nombre_compania IS NULL OR nombre_compania = ''''');
INSERT INTO dqm.reglas_calidad VALUES (8, 'CONSISTENCIA_FK_PRODUCTO', 'Cada producto_sk en la tabla de hechos debe existir en la dimensión de productos.', 'dwa_fact_ventas', 'producto_sk', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM dwa_fact_ventas f LEFT JOIN dwa_dim_producto d ON f.producto_sk = d.producto_sk WHERE d.producto_sk IS NULL AND f.producto_sk IS NOT NULL');
INSERT INTO dqm.reglas_calidad VALUES (9, 'CONSISTENCIA_FK_CLIENTE', 'Cada cliente_sk en la tabla de hechos debe existir en la dimensión de clientes.', 'dwa_fact_ventas', 'cliente_sk', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM dwa_fact_ventas f LEFT JOIN dwa_dim_cliente d ON f.cliente_sk = d.cliente_sk WHERE d.cliente_sk IS NULL AND f.cliente_sk IS NOT NULL');
INSERT INTO dqm.reglas_calidad VALUES (10, 'UNICIDAD_CLIENTE_ACTUAL', 'No debería haber dos registros de clientes activos con el mismo ID de negocio (customer_id).', 'dwa_dim_cliente', 'customer_id', 'Unicidad', 0.00, 'SELECT COUNT(*) FROM (SELECT customer_id FROM dwa_dim_cliente WHERE es_actual = TRUE GROUP BY customer_id HAVING COUNT(*) > 1) AS duplicados');
INSERT INTO dqm.reglas_calidad VALUES (22, 'VENTA_TOTAL_CONSISTENTE', 'El monto total derivado debe ser consistente.', 'fact_table', 'total_amount', 'Validez', 1.00, 'SELECT COUNT(*) FROM fact_table WHERE total_amount <> (unit_price * quantity * (1 - discount))');
