INSERT INTO public.dqm_reglas_calidad VALUES (1, 'VENTA_PRECIO_NO_NEGATIVO', 'El precio unitario no puede ser menor a cero.', 'fact_table', 'unit_price', 'Validez', 0.00, 'SELECT COUNT(*) FROM fact_table WHERE unit_price < 0');
INSERT INTO public.dqm_reglas_calidad VALUES (2, 'VENTA_CANTIDAD_NO_NEGATIVA', 'La cantidad vendida no puede ser cero o negativa.', 'fact_table', 'quantity', 'Validez', 0.00, 'SELECT COUNT(*) FROM fact_table WHERE quantity <= 0');
INSERT INTO public.dqm_reglas_calidad VALUES (3, 'VENTA_TOTAL_CONSISTENTE', 'El monto total derivado debe ser consistente con precio, cantidad y descuento.', 'fact_table', 'total_amount', 'Validez', 1.00, 'SELECT COUNT(*) FROM fact_table WHERE total_amount <> (unit_price * quantity * (1 - discount))');
INSERT INTO public.dqm_reglas_calidad VALUES (4, 'VENTA_FK_CLIENTE_COMPLETA', 'Todas las ventas deben estar asociadas a un cliente válido.', 'fact_table', 'customer_key', 'Completitud', 1.00, 'SELECT COUNT(*) FROM fact_table WHERE customer_key IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (5, 'CLIENTE_NOMBRE_COMPLETO', 'El nombre de la compañía del cliente no puede ser nulo o vacío.', 'dim_customer', 'company_name', 'Completitud', 2.00, 'SELECT COUNT(*) FROM dim_customer WHERE company_name IS NULL OR company_name = ''''');
INSERT INTO public.dqm_reglas_calidad VALUES (6, 'CONSISTENCIA_FK_PRODUCTO', 'Cada product_key en fact_table debe existir en dim_product.', 'fact_table', 'product_key', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM fact_table f LEFT JOIN dim_product d ON f.product_key = d.product_key WHERE d.product_key IS NULL AND f.product_key IS NOT NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (7, 'CONSISTENCIA_FK_CLIENTE', 'Cada customer_key en fact_table debe existir en dim_customer.', 'fact_table', 'customer_key', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM fact_table f LEFT JOIN dim_customer d ON f.customer_key = d.customer_key WHERE d.customer_key IS NULL AND f.customer_key IS NOT NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (31, 'CONSISTENCIA_FK_EMPLEADO', 'Cada employee_key en fact_table debe existir en dim_employee.', 'fact_table', 'employee_key', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM fact_table f LEFT JOIN dim_employee d ON f.employee_key = d.employee_key WHERE d.employee_key IS NULL AND f.employee_key IS NOT NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (32, 'CONSISTENCIA_FK_PROD_CAT', 'Cada category_key en dim_product debe existir en dim_category.', 'dim_product', 'category_key', 'Consistencia', 0.00, 'SELECT COUNT(*) FROM dim_product p LEFT JOIN dim_category c ON p.category_key = c.category_key WHERE c.category_key IS NULL AND p.category_key IS NOT NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (33, 'CATEGORIA_ID_COMPLETITUD', 'El identificador de la categoría no puede ser nulo.', 'tmp_categories', 'category_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_categories WHERE category_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (34, 'PROVEEDOR_ID_COMPLETITUD', 'El identificador del proveedor no puede ser nulo.', 'tmp_suppliers', 'supplier_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_suppliers WHERE supplier_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (35, 'PRODUCTO_NOMBRE_COMPLETITUD', 'El nombre del producto no puede ser nulo o vacío.', 'tmp_products', 'product_name', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_products WHERE product_name IS NULL OR product_name = ''''');
INSERT INTO public.dqm_reglas_calidad VALUES (36, 'CLIENTE_ID_COMPLETITUD', 'El identificador del cliente no puede ser nulo.', 'tmp_customers', 'customer_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_customers WHERE customer_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (37, 'EMPLEADO_ID_COMPLETITUD', 'El identificador del empleado no puede ser nulo.', 'tmp_employees', 'employee_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_employees WHERE employee_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (38, 'ORDEN_FECHA_COMPLETITUD', 'La fecha de la orden es obligatoria.', 'tmp_orders', 'order_date', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_orders WHERE order_date IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (39, 'DETALLE_PRECIO_VALIDEZ', 'El precio unitario debe ser mayor o igual a cero.', 'tmp_order_details', 'unit_price', 'Validez', 0.00, 'SELECT COUNT(*) FROM tmp_order_details WHERE unit_price < 0');
INSERT INTO public.dqm_reglas_calidad VALUES (40, 'TRANSPORTISTA_ID_COMPLETITUD', 'El ID del transportista no puede ser nulo.', 'tmp_shippers', 'shipper_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_shippers WHERE shipper_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (41, 'REGION_ID_COMPLETITUD', 'El identificador de región es obligatorio.', 'tmp_region', 'region_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_region WHERE region_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (42, 'TERRITORIO_DESC_COMPLETITUD', 'La descripción del territorio no puede estar vacía.', 'tmp_territories', 'territory_description', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_territories WHERE territory_description IS NULL OR territory_description = ''''');
INSERT INTO public.dqm_reglas_calidad VALUES (43, 'EMP_TERR_RELACION_COMPLETITUD', 'La relación debe tener un ID de empleado válido.', 'tmp_employee_territories', 'employee_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_employee_territories WHERE employee_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (44, 'DEMOGRAFIA_TIPO_COMPLETITUD', 'El tipo de demografía es obligatorio.', 'tmp_customer_demographics', 'customer_type_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_customer_demographics WHERE customer_type_id IS NULL');
INSERT INTO public.dqm_reglas_calidad VALUES (45, 'CLIENTE_DEMO_RELACION_COMPLETITUD', 'El ID del cliente en la relación no puede ser nulo.', 'tmp_customer_customer_demo', 'customer_id', 'Completitud', 1.00, 'SELECT COUNT(*) FROM tmp_customer_customer_demo WHERE customer_id IS NULL');
