INSERT INTO public.dwm_employees VALUES (1, 'Davolio', 'Nancy', 'Sales Representative', 'Ms.', '1948-12-08', '1992-05-01', '507 20th Ave. E. Apt. 2A', 'Seattle', 'WA', '98122', 'United States', '(206) 555-9857', '5467', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d20540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Education includes a BA in psychology from Colorado State University in 1970.  She also completed The Art of the Cold Call.  Nancy is a member of Toastmasters International.', 2, 'http://accweb/emmployees/davolio.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (3, 'Leverling', 'Janet', 'Sales Representative', 'Ms.', '1963-08-30', '1992-04-01', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'United States', '(206) 555-3412', '3355', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000080540000424d80540000000000007600000028000000c0000000e0000000010004000000000000540000ce0e0000d80e0000000000', 'Janet has a BS degree in chemistry from Boston College (1984). She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.', 2, 'http://accweb/emmployees/leverling.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (4, 'Peacock', 'Margaret', 'Sales Representative', 'Mrs.', '1937-09-19', '1993-05-03', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'United States', '(206) 555-8122', '5176', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d20540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.', 2, 'http://accweb/emmployees/peacock.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (5, 'Buchanan', 'Steven', 'Sales Manager', 'Mr.', '1955-03-04', '1993-10-17', '14 Garrett Hill', 'London', NULL, 'SW1 8JR', 'United Kingdom', '(71) 555-4848', '3453', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d20540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Steven Buchanan graduated from St. Andrews University in Scotland with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992 he spent 6 months in an orientation program at the Seattle office.', 2, 'http://accweb/emmployees/buchanan.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (6, 'Suyama', 'Michael', 'Sales Representative', 'Mr.', '1963-07-02', '1993-10-17', 'Coventry House Miner Rd.', 'London', NULL, 'EC2 7JR', 'United Kingdom', '(71) 555-7773', '428', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d16540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Michael is a graduate of Sussex University (MA Economics 1983) and the University of California at Los Angeles (MBA marketing 1986).  He has also taken the courses Multi-Cultural Selling and Time Management for the Sales Professional.', 5, 'http://accweb/emmployees/davolio.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (9, 'Dodsworth', 'Anne', 'Sales Representative', 'Ms.', '1966-01-27', '1994-11-15', '7 Houndstooth Rd.', 'London', NULL, 'WG2 7LT', 'United Kingdom', '(71) 555-4444', '452', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d16540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.', 5, 'http://accweb/emmployees/davolio.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (7, 'King', 'Robert', 'Sales Representative', 'Mr.', '1960-05-29', '1994-01-02', 'Edgeham Hollow Winchester Way', 'London', NULL, 'RG1 9SP', 'United Kingdom', '(71) 555-5598', '465', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d16540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992 the year he joined the company.', 5, 'http://accweb/emmployees/davolio.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (8, 'Callahan', 'Laura', 'Inside Sales Coordinator', 'Ms.', '1958-01-09', '1994-03-05', '4726 11th Ave. N.E.', 'Seattle', 'WA', '98105', 'United States', '(206) 555-1189', '2344', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d16540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.', 2, 'http://accweb/emmployees/davolio.bmp', '2025-11-27 14:18:03.806851', true);
INSERT INTO public.dwm_employees VALUES (2, 'Fuller', 'Andrew', 'Vice President Sales', 'Dr.', '1952-02-19', '1992-08-14', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'United States', '(206) 555-9482', '3457', '\x151c2f00020000000d000e0014002100ffffffff4269746d617020496d616765005061696e742e506963747572650001050000020000000700000050427275736800000000000000000020540000424d20540000000000007600000028000000c0000000df0000000100040000000000a0530000ce0e0000d80e0000000000', 'Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative was promoted to sales manager', NULL, 'http://accweb/emmployees/fuller.bmp', '2025-11-27 14:18:03.806851', true);
