--
-- TOC entry 316 (class 1259 OID 17791)
-- Name: vw_sales_by_employee; Type: VIEW; Schema: public; Owner: sarah
--

CREATE VIEW public.vw_sales_by_employee AS
 SELECT de.employee_key,
    de.full_name,
    de.country,
    dt.year,
    dt.quarter,
    sum(ft.total_amount) AS total_revenue,
    count(ft.fact_key) AS total_orders,
        CASE
            WHEN (count(ft.fact_key) > 0) THEN round((sum(ft.total_amount) / (count(ft.fact_key))::numeric), 2)
            ELSE (0)::numeric
        END AS average_order_value,
    sum(ft.quantity) AS total_units_sold
   FROM ((public.fact_table ft
     JOIN public.dim_employee de ON ((de.employee_key = ft.employee_key)))
     JOIN public.dim_time dt ON ((dt.date_key = ft.date_key)))
  GROUP BY de.employee_key, de.full_name, de.country, dt.year, dt.quarter;


ALTER VIEW public.vw_sales_by_employee OWNER TO sarah;

